  false,\n\t\"url\": null,\n\t\"notes\": \"The Oregon Department of Geology & Mineral
  Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
  topographic LiDAR data for multiple areas within the State of Oregon. The areas
  for LiDAR collection have been designed as part of a collaborative effort of state,
  federal, and local agencies in order to meet a wide range of project goals. This
  LiDAR data set was collected August 23, 24, 31, Sept 2 - 5, 2010 and falls mainly
  in Klamath County, and very small portions of Douglas and Jackson counties in Oregon.
  This data set consists of bare earth and unclassified points. The average pulse
  density is 8.39 pulses per square meter over terrestrial surfaces. The area of interest
  (AOI) totals 283 square miles (181,081 acres) and the total area flown (TAF) covers
  308 square miles (197,011 acres). The TAF acreage is greater than the original AOI
  acreage due to buffering and flight planning optimization. In some areas of heavy
  vegetation or forest cover, there may be relatively few ground points in the LiDAR
  data. Elevation values for open water surfaces are not valid elevation values because
  few LiDAR points are returned from water surfaces. LiDAR intensity values were also
  collected.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
